//*************** PDC *****************
/*When setting up the PDC coords remember that the 0,0 of configurator is not the same as PDC. The 0,0 of the configurator is in top right, in PDC it is lower left
 * In the PDC additional pplinths are placed on top of the previous ones - thus raising the zero point of the cabinet
 * In the configurator the plinths are placed on the bottom of previous ones - thus the zero point of the cabinet stays the same
 * Therefor the plinth height must be calculated and added to any addtional position.
 * The coords of the plinth is ALWAYS (0,0) in the PDC
 */


